import { Carousel } from 'antd';
import { Fragment } from 'react';

const CarouselComp = () => {
    return (
        <div id="MyCarousel">
            <style>{`
                #MyCarousel{
                    .img{
                        height:450px;
                        width: 100%;
                        overflow:hidden
                    }
                    img{
                        width:100%;
                    }
                }
                .ant-carousel .slick-slide {
                    text-align: center;
                    line-height: 160px;
                    background: #364d79;
                    overflow: hidden;
                }
                .ant-carousel .slick-slide h3 {
                    color: #fff;
                }
            `}
            </style>
            <Carousel >
                <div className="img">
                    <img src='/images/house1.jpg' alt="house1"/>    
                </div>
                <div>
                    <h3>2</h3>
                </div>
                <div>
                    <h3>3</h3>
                </div>
                <div>
                    <h3>4</h3>
                </div>
            </Carousel>
        </div>

    )
}

export default CarouselComp;
